import React, { useState} from 'react';
import APIService from '../../APIService';
import IconPic from '../../images/IsseLogo2.png';
import {
  UploadContainer,
  UploadWrapper,
  UploadContTop,
  UploadContBottom,
  Icon,
  Img,
  Form,
  FormH1,
  UploadIcon,
  FormButton,
  FormLabel,
  FormSelect,
  ContLeft,
  ContRight,
  Cont,
  ContMessage,
  FormButtonBrowse,
  ContSub,
} from './UploadElements';

const Upload = () => {

  const [title, setTitle] = useState("");
